import React, { useEffect } from "react"
import { useNavigate } from "react-router-dom"
import Table from "@mui/material/Table";
import TableHead from "@mui/material/TableHead";
import TableBody from "@mui/material/TableBody";
import TableRow from "@mui/material/TableRow";
import TableCell from "@mui/material/TableCell";

const creditData= [{credit:2000, price:20},{credit:3000, price:29},{credit: 4000, price: 35}];
const Credit = () => {
  const navigate = useNavigate()

  return <div onClick={() => navigate("/services")}>Credit

  <Table>
  <TableHead>
    <TableRow>
      <TableCell  className="TableCellStyle">크레딧</TableCell>
      <TableCell  className="TableCellStyle">가격 </TableCell>
      <TableCell  className="TableCellStyle">버튼 </TableCell>
    </TableRow>
  </TableHead>
  <TableBody>
  {creditData.map(({credit, price}, index) => (
   <TableRow>    
      <TableCell className="TableCellStyle">{credit}</TableCell>
      <TableCell className="TableCellStyle">{price} </TableCell>
      <TableCell className="TableCellStyle"><button>구매</button></TableCell>
    </TableRow>
   ))} </TableBody>
</Table>

</div>

}

export default Credit

